import React, { useState, useEffect } from 'react';
import { View, Image, ImageBackground, Text, Picker } from 'react-native';
import { RectButton, ScrollView, TextInput } from 'react-native-gesture-handler';
import { useNavigation, useRoute } from '@react-navigation/native';

import styles from './estilo';

export default function tEditarCadastroC() {
  const route = useRoute();
  const navigation = useNavigation();

  const [nome, setnome] = useState(route.params?.nome || '');
  const [sobrenome, setsobrenome] = useState(route.params?.sobrenome || '');
  const [data_de_nasc, setdata_de_nasc] = useState(route.params?.data_de_nasc || '');
  const [cpf, setcpf] = useState(route.params?.cpf || '');
  const [sexo, setsexo] = useState(route.params?.sexo || '');
  const [celular, setcelular] = useState(route.params?.celular || '');
  const [email, setemail] = useState(route.params?.email || '');
  const [senha, setsenha] = useState(route.params?.senha || '');
  const [preco, setpreco] = useState(route.params?.preco || '');
  const [link, setlink] = useState(route.params?.link || '');
  const [cep, setCep] = useState(route.params?.cep || '');
  const [logradouro, setLogradouro] = useState(route.params?.logradouro || '');
  const [localidade, setLocalidade] = useState(route.params?.localidade || '');
  const [uf, setUf] = useState(route.params?.uf || '');
  const [bairro, setBairro] = useState(route.params?.bairro || '');

  const opcoesSexo = [
    { label: 'Masculino', value: 1 },
    { label: 'Feminino', value: 2 },
    { label: 'Não binário', value: 3 },
    { label: 'Prefiro não responder', value: 4 },
  ];

  useEffect(() => {
    // Adicione aqui a lógica para buscar os dados cadastrados do usuário
    // e preencher os campos do formulário.
  }, []);

  function handleSave() {
    // Adicione aqui a lógica para salvar os dados editados
    // do usuário no banco de dados ou em algum lugar de armazenamento.

    // Navegar para a tela de visualização dos dados atualizados ou para outra tela desejada.
    navigation.navigate('tVisualizarCadastroC', {
      nome,
      sobrenome,
      data_de_nasc,
      cpf,
      sexo,
      celular,
      email,
      senha,
      preco,
      link,
      cep,
      logradouro,
      localidade,
      uf,
      bairro,
    });
  }

  function handleCancel() {
    // Navegar de volta para a tela anterior
    navigation.goBack();
  }

  return (
    <ImageBackground style={styleGeral.container}>
      <View>
        <Image style={{ width: 100, height: 109, marginTop: -30 }} source={require('../../../assets/logo.png')} />
      </View>

      <ScrollView style={styles.form}>
        <View style={styles.fieldGroup}>
          <TextInput
            style={styles.input}
            placeholder="Nome"
            value={nome}
            onChangeText={setnome}
          />
          <TextInput
            style={styles.input}
            placeholder="Sobrenome"
            value={sobrenome}
            onChangeText={setsobrenome}
          />
        </View>

        <TextInput
          style={styles.input}
          placeholder="Data de Nascimento"
          value={data_de_nasc}
          onChangeText={setdata_de_nasc}
        />
        <TextInput
          style={styles.input}
          placeholder="CPF"
          value={cpf}
          onChangeText={setcpf}
        />

        <Picker
          style={styles.input}
          selectedValue={sexo}
          onValueChange={(itemValue) => setsexo(itemValue)}
        >
          {opcoesSexo.map((opcao) => (
            <Picker.Item key={opcao.value} label={opcao.label} value={opcao.value} />
          ))}
        </Picker>

        <TextInput
          style={styles.input}
          placeholder="Celular"
          value={celular}
          onChangeText={setcelular}
        />
        <TextInput
          style={styles.input}
          placeholder="E-mail"
          value={email}
          onChangeText={setemail}
        />
        <TextInput
          style={styles.input}
          placeholder="Senha"
          value={senha}
          onChangeText={setsenha}
          secureTextEntry
        />

        <View style={styles.fieldGroup}>
          <TextInput
            style={styles.input}
            placeholder="Preço"
            value={preco}
            onChangeText={setpreco}
          />
          <TextInput
            style={styles.input}
            placeholder="Link"
            value={link}
            onChangeText={setlink}
          />
        </View>

        <TextInput
          style={styles.input}
          placeholder="CEP"
          value={cep}
          onChangeText={setCep}
        />
        <TextInput
          style={styles.input}
          placeholder="Logradouro"
          value={logradouro}
          onChangeText={setLogradouro}
        />
        <TextInput
          style={styles.input}
          placeholder="Localidade"
          value={localidade}
          onChangeText={setLocalidade}
        />
        <TextInput
          style={styles.input}
          placeholder="UF"
          value={uf}
          onChangeText={setUf}
        />
        <TextInput
          style={styles.input}
          placeholder="Bairro"
          value={bairro}
          onChangeText={setBairro}
        />

        <View style={styles.buttonContainer}>
          <RectButton style={styles.saveButton} onPress={handleSave}>
            <Text style={styles.buttonText}>Salvar</Text>
          </RectButton>

          <RectButton style={styles.cancelButton} onPress={handleCancel}>
            <Text style={styles.buttonText}>Cancelar</Text>
          </RectButton>
        </View>
      </ScrollView>
    </ImageBackground>
  );
}
